import React from 'react';
import './feed.css';
// import SliderPage from './slider';

class Feed extends React.Component {
  constructor(){
    super();
    this.state = {
      value:5
    }
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);

  }
  handleChange(event) {
    this.setState({value: event.target.value});
    console.log(this.state.value)
  }
  handleSubmit(event) {
    // alert('Your favorite flavor is: ' + this.state.value);
    event.preventDefault();


  }
  render() {
    return(
        <div>
            <label className='label'>A. TIME MANAGEMENT SKILLS</label>
            <div className='container'>
                       <form onSubmit={this.handleSubmit}>

                           <p>1<label for="question" className="fa fa-long-arrow-right">Punctuality in the Class</label></p>
                           <input type="range" className="slider" id="customRange1" min="0" max="10" value={this.state.value}  onChange={this.handleChange} />
                           <input type="submit" value="Submit" />

                           <p>2<label for="question" className="fa fa-long-arrow-right">Regularity in taking Classes</label></p>
                           <input type="range" className="slider" id="customRange1" min="0" max="10" value={this.state.value}  onChange={this.handleChange} />
                           <input type="submit" value="Submit" />

                           <p>3<label for="question" className="fa fa-long-arrow-right">Student's attendance/presence in the class of teacher who is being evaluated</label></p>
                           <input type="range" className="slider" id="customRange1" min="0" max="10" value={this.state.value}  onChange={this.handleChange} />
                           <input type="submit" value="Submit" />

                           <p>4<label for="question" className="fa fa-long-arrow-right">Completes syllabus of the course as per teaching plan</label></p>
                           <input type="range" className="slider" id="customRange1" min="0" max="10" value={this.state.value}  onChange={this.handleChange} />
                           <input type="submit" value="Submit" />

                           <p>5<label for="question" className="fa fa-long-arrow-right">Scheduled organization of assignments, class, test, quizzes and seminars</label></p>
                           <input type="range" className="slider" id="customRange1" min="0" max="10" value={this.state.value}  onChange={this.handleChange} />
                           <input type="submit" value="Submit" />

                           <p>6<label for="question" className="fa fa-long-arrow-right">Scheduled organization of assignments, class, test, quizzes and seminars</label></p>
                           <input type="range" className="slider" id="customRange1" min="0" max="10" value={this.state.value}  onChange={this.handleChange} />
                           <input type="submit" value="Submit" />




{/*                        
                          2<i class="fa fa-long-arrow-right"></i>Regularity in taking Classes<SliderPage />
                          3<i class="fa fa-long-arrow-right"></i>Student's attendance/presence in the class of teacher who is being evaluated<SliderPage />
                          4<i class="fa fa-long-arrow-right"></i>Completes syllabus of the course as per teaching plan<SliderPage />
                          5<i class="fa fa-long-arrow-right"></i>Scheduled organization of assignments, class, test, quizzes and seminars<SliderPage />
                          6<i class="fa fa-long-arrow-right"></i>Makes alternate arrangement of class in his/her absence<SliderPage /> */}
                      </form>
            </div>
            <button type="button" className='btn btn-success'>Next</button>
        </div>

    );
  }
}

export default Feed;
